import React from 'react';
import Link from 'components/Link';
import Typography from 'components/Typography';
import { getJson } from 'requests';
import config from 'config/index';


const GetEntitiesList = () => {
  const {
    BOOK_URL,
  } = config;

  const books = getJson({url: `${BOOK_URL}`})
  books.then(value => console.log(value));
  //console.log();

  return (
    <div>
      {books.map((book) => (
        <Link
          href={(location => ({
              ...location,
              pathname: `/${book}`,
              search: `${location.search}&id=42`,
            }))}
        >
          <Typography>
            {book}
          </Typography>
        </Link>
      ))}
    </div>
  )
};

export default GetEntitiesList;
